import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";

import Header from "./components/Header";
import Game from "./components/Game";

import "./App.css";

function App(props) {
	return (
		<>
			<CssBaseline>
				<Header />
				<Game />
			</CssBaseline>
		</>
	);
}

export default App;
